#include <vector>
#include <cstring>
#include <iostream>
using namespace std;

class Solution {

public:

	bool visit[800][800];
	vector<vector<char> > _b;int m,n;
	int dx[4]={0,0,-1,1},dy[4]={-1,1,0,0};//up, down, left, right
    void solve(vector<vector<char> > &board) {
		m=board.size();//row
		if(m<=0) return;
		n=board[0].size();//col
		if(n<=0) return;
		_b=board;
		memset(visit,0,sizeof(visit));
		for(int j=0;j<n;j++)
		{
			if(!visit[0][j] && _b[0][j]=='O')
				dfs_edge(0,j);
			if(!visit[m-1][j] && _b[m-1][j]=='O')
				dfs_edge(m-1,j);
		}
		for(int i=1;i<m-1;i++)
		{
			if(!visit[i][0] && _b[i][0]=='O')
				dfs_edge(i,0);
			if(!visit[i][n-1] && _b[i][n-1]=='O')
				dfs_edge(i,n-1);
		}
		for(int i=1;i<m-1;i++)
		{
			for(int j=1;j<n-1;j++)
			{
				if(!visit[i][j])dfs_inside(i,j);
			}
		}
		
		board=_b;
		
    }
	void dfs_inside(int i, int j)
	{
		visit[i][j]=1;
		if(_b[i][j]=='O') _b[i][j]='X';
		for(int k=0;k<4;k++)
			if(i+dx[k]<=m-1 && i+dx[k]>=0 && j+dy[k]<=n-1 && j+dy[k]>=0 && !visit[i+dx[k]][j+dy[k]] && _b[i+dx[k]][j+dy[k]]=='O') 
				dfs_inside(i+dx[k],j+dy[k]);
	}
	void dfs_edge(int i, int j)
	{
		visit[i][j]=1;
		for(int k=0;k<4;k++)
			if(i+dx[k]<=m-1 && i+dx[k]>=0 && j+dy[k]<=n-1 && j+dy[k]>=0 && !visit[i+dx[k]][j+dy[k]] && _b[i+dx[k]][j+dy[k]]=='O')
				dfs_edge(i+dx[k],j+dy[k]);
	}
} F;

